function getIdiomaParaCookie(idiomaDestino){
	if(idiomaDestino=='es')		
		return 'es_ES';
	else if(idiomaDestino=='ca')
		return 'ca_ES';
	else if(idiomaDestino=='gl')
		return 'gl_ES';
	else if(idiomaDestino=='ca-valencia')
		return 'va_ES';
	else if(idiomaDestino=='en')
		return 'en_GB';
	else 
		return idiomaDestino.replace('-','_');
}

function cambiaIdioma() {
	try{		
		if(jQuery('#idiomas').length!=0){
			var idiomaEncontrado=false;
			var url = document.URL;
			var iDom = url.indexOf('vgn-ext-templating');
			var dominio;
			indexLocale = -1;
			if(iDom>0){
				dominio = 0; //preview
				indexLocale = url.indexOf('vgnLocale')+10;
			}else{
				dominio = 1; //produccion o render
				
				iDom = url.indexOf(sedeUtils.dominioPortal);//solo para cabeceras de portal
				if(iDom < 0){
					iDom = url.indexOf(sedeUtils.render); //solo para cabeceras de portal de RENDER
				}
				if(iDom !=-1){
					indexLocale = url.indexOf(sedeUtils.carpetaSite)+sedeUtils.carpetaSite.length;
					//Si estamos en castellano no lleva el locale en url
					//se lo ponemos temporalmente para igualar el formato de url
					
					for(var i=0;i<sedeUtils.locales.length;i++){
	//--T#224						
						if(document.URL.indexOf(sedeUtils.locales[i].toLowerCase())==indexLocale){
	//T#224--							
							idiomaEncontrado=true;
							break;
						}
					}
					if (!idiomaEncontrado) {					
							url = url.substring(0,indexLocale) + 'es_es/' + url.substring(indexLocale);					
					}
					
				}
				
			}
			
			if(iDom!=-1){
				if(indexLocale>0){
					//Comprobamos que no estemos en la pagina de inicio
					if((url.indexOf(sedeUtils.carpetaSite)>0) || dominio==0){ 
						var nuevoHref = '';		
						//Buscamos cada enlace de idioma
						jQuery('#idiomas A,.idiomasPie A').each(
							function(){
								var idiomaDestino = getIdiomaParaCookie(jQuery(this).attr('lang'));
								
								if(idiomaDestino=='ca_ES'){
									var indexInicio;
									var urlEnlace=jQuery(this).attr('href');
									if(dominio==1 || urlEnlace.indexOf('vgn-ext-templating')==-1){
										indexInicio=urlEnlace.indexOf(sedeUtils.carpetaSite)+sedeUtils.carpetaSite.length;
										idiomaDestino = urlEnlace.substring(indexInicio,indexInicio+2)+'_'+urlEnlace.substring(indexInicio+3,indexInicio+5);
									}
									else if(dominio==0 && urlEnlace.indexOf('vgn-ext-templating')!=-1){
										indexInicio=urlEnlace.indexOf('vgnLocale')+10;
										idiomaDestino = urlEnlace.substring(indexInicio,indexInicio+5);
									}
								}								
								if(dominio==1) idiomaDestino = idiomaDestino.toLowerCase();
								
								if(idiomaDestino=='es_es' && dominio==1){//en produccion al estar en castellano no hay locale en url
									nuevoHref = url.substring(0,indexLocale) + url.substring(indexLocale+6);
								}else{
									nuevoHref = url.substring(0,indexLocale) + idiomaDestino + url.substring(indexLocale+5);
								}
								jQuery(this).attr('href',nuevoHref);
							}
						);			
					}
				}
			}else{
				jQuery('#idiomas A,.idiomasPie A').each(function(){
					jQuery(this).attr('href',document.location.href).bind('click', function(e){
						e = e || window.event;
						e.preventDefault();
						var idiomaDestino = getIdiomaParaCookie(jQuery(this).attr('lang'));
						setCookie("aeat-language",idiomaDestino);
						location.reload();
					});
				});
			}
		}
	}catch(e){
		console.log(e);
	}
}

