/*
 * Maquetacion de iconos de tramite a la izquierda del texto.
 */

function mostrarIconoAccesoTramite($enlace){
	//Elimina el icono si ya tenia
	//var iconoAntiguo = $enlace.next();
	
	//if(iconoAntiguo!=undefined && iconoAntiguo.prop('tagName')=='SPAN' && !iconoAntiguo.hasClass('popup')) iconoAntiguo.remove();
	//Comprueba los accesos disponibles
	var accesos = $enlace.attr('data-acceso').split(';');
	var printOtros = true;
	
	for(var i = 0; i < accesos.length; i++){
		if(accesos[i] =='Ref' || accesos[i] =='SinCert'){
			printOtros = false;
			break;
		}
	}
	//Recorre todos los tipos de acceso y si coincide con los disponibles lo inserta. (Ordenado)
	jQuery.each(accesoTramiteSelector.tipos,function(indice,datosAcceso){
		if(datosAcceso["icono"]!=undefined){
			
			var urlTramite=$enlace.attr('href');
			var tituloTramite='';
			
			var codTramite = $enlace.attr('codigo');
			var codProc = $enlace.attr('codigo_proc');
			if(codProc != undefined) 
				tituloTramite += codProc;
			else	
				tituloTramite += ' ';
			if(codTramite!=undefined) 
				tituloTramite += ' | ' + codTramite + ' ';
			else 	
				tituloTramite+=' | ';
			if(codProc==undefined && codTramite==undefined) tituloTramite=' | ';
			
			tituloTramite += ' | ' + $enlace.text();
			if(isHome()){
				if(accesos.length == 1 && accesos[0] == indice){
					if(contieneDominioValido(urlTramite)){
						urlTramite=urlTramite.replace(/^.*\/\/[^\/]+/, datosAcceso["dominio"]);
					}
					jQuery('<a href="' + urlTramite + '" data-titulo="' + tituloTramite + '" title="' + datosAcceso["locale"][lang] + '"><span class="' + datosAcceso["icono"] + ' conPunteroEnlace"></span></a>')
					.bind('click', function(e){
						e = e || window.event;
						e.preventDefault();
						seguimientoTramite(jQuery(this));
					}).insertBefore($enlace.prev());
				}
			}else{
				if(!printOtros || (indice !='Ref' && indice !='SinCert')){
					var valorAcceso = null;
					for(var i = 0; i < accesos.length; i++){
						if(accesos[i] ==indice){
							valorAcceso = accesos[i];
							break;
						}
					}
					if (valorAcceso != null){
						//Calcula la URL destino
						if(contieneDominioValido(urlTramite)){
							urlTramite=urlTramite.replace(/^.*\/\/[^\/]+/,datosAcceso["dominio"]);
						}
						//
						jQuery('<a href="'+urlTramite+'" data-titulo="'+tituloTramite+'" title="'+datosAcceso["locale"][lang]+'"><span class="'+datosAcceso["icono"]+' conPunteroEnlace"></span></a>')
						.bind('click', function(e){
							e = e || window.event;
							e.preventDefault();
							seguimientoTramite(jQuery(this));
						}).insertBefore($enlace.prev());
					}else{
						if(indice !='Ref' && indice !='SinCert')
							jQuery('<span data-titulo="'+tituloTramite+'" title="'+datosAcceso["locale"][lang]+'" class="'+datosAcceso["icono"]+'Desactivado"></span>').insertBefore($enlace.prev());
					}
				}else{
					if(indice !='Ref')
						jQuery('<span data-titulo="'+tituloTramite+'" title="'+datosAcceso["locale"][lang]+'" class="'+datosAcceso["icono"]+'Desactivado"></span>').insertBefore($enlace.prev());
				}
			}
		}
	});
}

function seleccionarAccesoTramite($ancla) {
	var enlaceRegistro='';
	
	enlaceRegistro='<div class="enlaceRegistro"><span class="lista1"></span><a href="'+accesoTramiteSelector.registroClave["url"]+'" target="_blank">'+accesoTramiteSelector.registroClave["locale"][lang]+'</a></div>';
	var enlaceAyuda='<div class="selectorAccesoAyuda"><a href="'+accesoTramiteSelector.urlAyuda[lang]+'" target="_blank" class="enlaceAyudaTramite"><span class="labelAyudaTramite">'+accesoTramiteSelector.textoAyuda[lang]+'</span></a></div>';

	var $selector=jQuery('<div id="dialogoAcceso"><div class="tituloApp">'+$ancla.text()+'</div><div><div class="mensajeAcceso">'+accesoTramiteSelector.textoSeleccionAcceso[lang]+'</div>'+enlaceAyuda+'<div class="clear"></div></div><div class="metodos"></div></div>');
	var accesos=$ancla.attr('data-acceso').split(';');
	
	//Recorre todos los tipos de acceso y si coincide con los disponibles lo inserta. (Ordenado)
	jQuery.each(accesoTramiteSelector.tipos,function(indice,datosAcceso){
		if(datosAcceso["dominio"]!=undefined){
			jQuery.each(accesos,function(indice2,valor){
				if(indice==valor){
					//Calcula la URL destino
					var urlTramite=$ancla.attr('href');
					urlTramite=urlTramite.replace(/^.*\/\/[^\/]+/,datosAcceso["dominio"]);
					var dataTitulo=$ancla.text();
					var codigo=$ancla.attr("codigo");
					if(codigo==undefined) codigo='';
					var codigo_proc=$ancla.attr("codigo_proc");
					if(codigo_proc==undefined) codigo_proc='';
					$selector.find('.metodos').append(
						jQuery('<a href="'+urlTramite+'" data-aeat-metodo="'+valor+'" target="'+$ancla.attr("target")+'" codigo="'+codigo+'" codigo_proc="'+codigo_proc+'" data-titulo="'+dataTitulo+'">'
							+'<span title="'+datosAcceso["locale"][lang]+'" class="'+datosAcceso["icono"]+'"></span><span class="labelAcceso">'+datosAcceso["locale"][lang]+'</span>'
						+'</a>')
					.bind('click', function(e){
						e = e || window.event;
						e.preventDefault();
						seguimientoTramite(jQuery(this));
						cerrarDialogoAcceso();
					}));
				}
			});
		}		
	});
	
	jQuery('body').append($selector);
	
	var opciones = {
	    modal: true,
	    draggable: false,
	    resizable:false,
	    dialogClass:'dialogoSinTitulo',
	    closeOnEscape:false,
	    width: 450,
	    buttons:[
	     {	    	
	    	text: accesoTramiteSelector.cerrarSelector[lang],
	    	click: function(){
				cerrarDialogoAcceso();
			}
	     }
	    ],
	    open: function(event,ui){
	    	//Inserta enlace a registro CL@VEPIN
	    	jQuery('.ui-dialog .ui-dialog-buttonpane').prepend(enlaceRegistro);
	    	//fix IE para focus
	    	jQuery('.mensajeAcceso').focus();
	    }
	};
	muestraMensajeConfirm(jQuery('#dialogoAcceso'), opciones);
}
