// Carga mediante AJAX la columna derecha de la home
function cargarMenuDerecha(){
	try{
		
		sedeUtils.tieneMenuDerecha=true;
		
		jQuery.ajaxSetup({cache: true});		
		jQuery('#columna-derecha,#contenedordersub').html('<div class="ajax-loader"></div>');
		var homeUrl = sedeUtils.urlPortal;
		if(document.domain!=sedeUtils.dominioPortal) homeUrl = jQuery('#navegacion UL LI A[href]:first').attr('href');
		if(homeUrl!=undefined) {
			jQuery('#columna-derecha,#contenedordersub').load(homeUrl+' #columna-derecha > DIV',function(){
				cargarDescripcionTitulo();
				plegarComponentes();
				sedeUtils.MenuDerechaFin.resolve();
			});
		}
		else{
			jQuery('.ajax-loader').hide();
		}
		jQuery.ajaxSetup({cache: false});
	}catch(e){}
}

