function getFechaDeCookie(cad){
	if(cad.indexOf('-') > -1)
		cad = cad.replace('-', '');
	var YY = parseInt(cad.substring(0,4));
	var MM = parseInt(cad.substring(4,6));
	var DD = parseInt(cad.substring(6,8));
	var hh = parseInt(cad.substring(8,10));
	var mm = parseInt(cad.substring(10,12));
	var ss = parseInt(cad.substring(12,14));
	var cc = parseInt(cad.substring(14,16));
	var fecha = Date.UTC(YY, MM - 1, DD, hh, mm, ss, cc);//Milliseconds
	return fecha;
}


