function pintarFechaOficial(fechor) {
	fechor = fechor.replace(' GMT','Z');		
	
	try {		
		sedeUtils.horaOficial = moment(fechor,'ddd, DD MMM YYYY HH:mm:ssZ');
		sedeUtils.horaOficial = sedeUtils.horaOficial.tz('Europe/Madrid');
		
		var salida = sedeUtils.horaOficial.format('DD/MM/YYYY HH:mm:ss');
	
	//	salida = salida.replace(/\+0(.):00/g,"GMT+$1");
		
		if (jQuery('.AEATReloj').length > 0) {
			jQuery('.AEATReloj').text(salida);
		}		
		if (jQuery('.topVarios .acciones ul li a .AEATReloj').length>0) {	
				jQuery('.topVarios .acciones ul li a .AEATReloj').parent().addClass('azul-negrita');													
		}	
		
		if (sedeUtils.horaOficialTimer != undefined)
			clearTimeout(sedeUtils.horaOficialTimer);
		
		sedeUtils.horaOficialTimer = setTimeout('actualizaReloj()', 1000);
		
	} catch(e) {		
	}
}

function obtenFechaServidor (ruta) {
	jQuery.ajaxSetup({cache: false});
	try {
		jQuery.get(ruta, function (data, textStatus, jqxhr){		
			var fechor = jqxhr.getResponseHeader('Date');
			if (fechor != undefined) {
		
				pintarFechaOficial(fechor);
			}
		});
	} catch(e){}
	
	jQuery.ajaxSetup({cache: true});
}

/* 
 * Realiza la carga del fichero externo, pero almacena la fecha y hora del servidor
 */
function cargaScriptGuardaFechaServidor (ruta) {
	jQuery.ajaxSetup({cache: false});
	
	try {
		jQuery.getScript(ruta, function (data, textStatus, jqxhr){		
			var fechor = jqxhr.getResponseHeader('Date');	
			
			if (fechor != undefined) {				
				pintarFechaOficial(fechor);
			}
		});			
	} catch(e){}
	
	jQuery.ajaxSetup({cache: true});
}

function actualizaReloj() {	
	
	sedeUtils.horaOficial.add(1,'seconds');
	
	var salida = sedeUtils.horaOficial.format('DD/MM/YYYY HH:mm:ss');

//	salida = salida.replace(/\+0(.):00/g,"GMT+$1");
	
	jQuery('.AEATReloj').text(salida);
	
	sedeUtils.horaOficialTimer = setTimeout('actualizaReloj()', 1000);
}

