function muestraConfirm(titulo, texto, id, botones, esModal, ancho, error, css){
	try {
		if(id==undefined) 
			id=Math.floor(Math.random()*101);
		if(esModal == undefined) 
			esModal = false;
		if(ancho == undefined) 
			ancho = 500;
		
		if(error == undefined)
			error = false;
		else if(error == 'none')
			error = undefined;
		
		if(css == undefined)
			css = '';
		
		var opciones = {};
		opciones.modal = esModal;
		opciones.width = ancho;
		opciones.resizable = false;
		opciones.dialogClass = css;
		opciones.position = {at: 'center center'};
		if(botones != undefined)
			opciones.buttons = botones;
		opciones.title = titulo;
		
		var mostrado = confirmModal(texto, id, error, opciones);
	}
	catch(e){mostrado = false;}
	return mostrado;
}

function muestraMensajeConfirm($element, opciones){
	try {
		if(opciones.modal == undefined) 
			opciones.modal = false;
		if(opciones.width == undefined) 
			opciones.width = 500;
		if(opciones.resizable == undefined) 
			opciones.resizable = false;
		if(opciones.dialogClass == undefined)  
			opciones.dialogClass = '';
		if(opciones.position== undefined)  
			opciones.position = {at: 'center center'};
		
		var mostrado = confirmModal(undefined, undefined, undefined, opciones, $element);
	}
	catch(e){mostrado = false;}
	return mostrado;
}

function confirmModal(texto, id, error, opciones, $element){
	
	var resultado = false;
	var estilo = '';
	if(error != undefined){
		estilo = 'AEAT_bloque_avisos';
		if(error)
			estilo = 'AEAT_bloque_errores';
	}
	try{
		var btns = {};
		if(opciones.buttons != undefined){
			jQuery.each(opciones.buttons, function(k, v){
				if(v.text == undefined){
					jQuery.each(v,function(k2,v2){
						if(typeof(v2) == 'string')
							btns[k2] = function(){eval(v2);};
						else if(typeof(v2) == 'function')
							btns[k2] = v2;
					});
				}else{
					btns[k] = v;
				}
			});
		}else{
			btns['Aceptar'] = function() {
				jQuery(this).dialog('close'); 
			} ;
		}
		
		opciones.buttons = btns;
		if($element == undefined){
			jQuery('body').append('<div id="'+ id +'"><div class="' + estilo +'">' + texto + '</div></div>');
			jQuery('#'+ id).dialog(opciones);
		}else{
			$element.dialog(opciones);
		}
		resultado = true;
	}
	catch(e){
		jQuery('#'+id).remove();
		resultado = false;
	}
	return resultado;
}

