//Fija una cookie para el dominio actual
function setCookieDominioActual(c_name,value, dias){
	try {
		if (dias) {
			var date = new Date();
			date.setTime(date.getTime()+(dias*24*60*60*1000));
			var expires = "; expires="+date.toGMTString();
		}
		jQuery.cookie(c_name, value, {
			path: '/',
			expires: date,
			domain: document.domain			
		});
	}
	catch(e){
		var cadenaCookie = c_name + "=" + value+expires+"; domain="+document.domain+"; path=/";
		document.cookie=cadenaCookie;
	}
}

