/*
 * 	Sustituido por seguimientoTramite
 */
//Fija un evento para cada clic en tramites
function insertarEventosTramites(){
	var url;
	var titulo;
	var codTramite;
	var codProc;
	var dominios=analyticsUtils.dominiosAppsAnalytics;
	var esTramite=0;
	try {
		jQuery('#contenedorProcedimiento A').each(function(){
			url = jQuery(this).attr('href');
			for(i=0;i<dominios.length;i++){
				if(url.indexOf(dominios[i])!=-1){
					esTramite=1;
				}
			}
			if (esTramite==1 && url != undefined) {
				//Localiza tipos de acceso al tramite
				var accesos=jQuery(this).attr('data-acceso');
			    var tiposAcceso=accesos.split(';');
			    //Si tiene varios tipos de acceso no aplica
			    if(tiposAcceso.length<2){
			    	titulo = jQuery(this).text();
					target = jQuery(this).attr('target');
					codTramite = jQuery(this).attr('codigo');
					codProc = jQuery(this).attr('codigo_proc');
					if(codTramite!=undefined) titulo+=' - '+codTramite;
					if(codProc!=undefined) titulo+=' - '+codProc;
					
					titulo=titulo.replace(/'/g,'-');
					//jQuery(this).attr('onClick', '_gaq.push([\'_trackEvent\',\'Tramites\',\'' + url + '\',\'' + titulo + '\'])');
					if(target=='_blank')
						//jQuery(this).attr('onClick', 'eventoTramites(this,\'' + url + '\',\'' + titulo + '\',\'externo\');return false;');
						jQuery(this).bind('click', function(e){
							e = e || window.event;
							e.preventDefault();
							eventoTramites(jQuery(this),url, titulo, 'externo');
						});
					else
						//jQuery(this).attr('onClick', 'eventoTramites(this,\'' + url + '\',\'' + titulo + '\');return false;');
						jQuery(this).bind('click', function(e){
							e = e || window.event;
							e.preventDefault();
							eventoTramites(this, url, titulo);
						});
					esTramite=0;
			    }
			}
		});
	}catch(e){}	
}
function eventoTramites(that,accion,etiqueta,externo){
	_gaq.push(['_trackEvent','Tramites',accion,etiqueta]);
	if(externo)
		setTimeout(function(){window.open(that.href);},100);
	else
		setTimeout(function(){location.href=that.href;},100);
}

//Invocado desde selector tramites
function seguimientoTramite($elemento){
	var accion, etiqueta, codTramite, codProc, dataTitulo;
	if($elemento.prop('tagName')=='SPAN'){
		accion=$elemento.attr('data-href');
		etiqueta=$elemento.attr('data-titulo');
	}
	else{
		//Es un ancla <A>
		codTramite=$elemento.attr('codigo');
		codProc=$elemento.attr('codigo_proc');
		if(codProc!=undefined && codProc!='') etiqueta=codProc;
		else	etiqueta=' ';
		if(codTramite!=undefined && codTramite!='') etiqueta+=' | '+codTramite;
		else 	etiqueta+=' | ';
		
		accion=$elemento.attr('href');
		dataTitulo=$elemento.attr('data-titulo');
		if(dataTitulo) etiqueta+=' | '+$elemento.attr('data-titulo');
		else etiqueta+=' | '+$elemento.text();
		
	}
	try{
		_gaq.push(['_trackEvent','Tramites',accion,etiqueta]);
	}catch(e){}	
	
	if($elemento.attr('target')=='_blank')
		setTimeout(function(){window.open(accion);},100);
	else
		setTimeout(function(){location.href=accion;},100);
}

function eventoAyudaTramite(accion,etiqueta,externo){
	_gaq.push(['_trackEvent','Ayuda_Tramite',accion,etiqueta]);
	if(externo)
		setTimeout(function(){window.open(accion);},100);
	else
		setTimeout(function(){location.href=accion;},100);
}

function insertarEventoAyudaTramite(){
	jQuery('.enlaceAyudaTramite').each(function(){
		var titulo = jQuery(this).find('SPAN').attr('title');
		var etiqueta = '';
		
		var codTramite = jQuery(this).prev().attr('codigo');
		var codProc = jQuery(this).prev().attr('codigo_proc');
		if(codProc!=undefined && codProc!='') etiqueta=codProc;
		else	etiqueta=' ';
		if(codTramite!=undefined && codTramite!='') etiqueta+=' | '+codTramite;
		else 	etiqueta+=' | ';
		etiqueta+=' | '+titulo;
		
		var target = jQuery(this).attr('target');
		var url = jQuery(this).attr('href');
		
		etiqueta=etiqueta.replace(/'/g,'-');
		if(target=='_blank')
			//jQuery(this).attr('onClick', 'eventoAyudaTramite(\'' + url + '\',\'' + etiqueta + '\',\'externo\');return false;');
			jQuery(this).bind('click', function(e){
				e = e || window.event;
				e.preventDefault();
				eventoAyudaTramite(url, etiqueta, 'externo');
			});
		else
			//jQuery(this).attr('onClick', 'eventoAyudaTramite(\'' + url + '\',\'' + etiqueta + '\');return false;');
			jQuery(this).bind('click', function(e){
				e = e || window.event;
				e.preventDefault();
				eventoAyudaTramite(url, etiqueta);
			});
	});
	
}

function iniciaTareasAnalytics() {
	try{		
		jQuery(document).ready(function(){
			// Entornos
			//if(document.domain.indexOf('gescont.aeat')!=-1 || document.domain==sedeUtils.dominioPortal) analyticsUtils.analyticsInApps = false;			
			
			if (document.domain == analyticsUtils.dominioAceptado || analyticsUtils.analyticsInApps) {
				//Control por parametro y cookie
				var analytics = getCookie('analytics');
				if (analytics == undefined) {
					iniciaAnalytics();
					insertarEventoAyudaTramite();
					
					/* 		Se estÃ¡ haciendo desde cargarSelectorAccesoTramite para un Ãºnico metodo de acceso 
					 * 		o desde seleccionarAccesoTramite para varios 
					*/
					//insertarEventosTramites();
				}
			}			
		});
	}
	catch(e){				
		//getScriptJQuery();
	}	
}



