/****************************************************************/
function cambiaSite(site) {
	url = window.location.href;
	indexSite = url.indexOf('site=');
	if (indexSite>=0) {
		for (i=indexSite+5; i < url.length && url.charAt(i)!='&' ; i++);
		if (i == url.length) {
			url = url.substring(0,indexSite+5) + site;
		} else {
			url = url.substring(0,indexSite+5) + site + url.substring(i);
		}
		window.location.replace(url);
	}	
}



